import { render } from '@testing-library/react';
import React from 'react'
import ReactDOM from 'react-dom';

function Nacionalidades(props) {
    const nacionalidades = props.nacionalidades;
    const listItems = nacionalidades.map((nacionalidades) =>   
        <li key={nacionalidades.toString()}>
          {nacionalidades}
        </li>  );  
          return (
            <ul>{listItems}</ul>  );
  }

    const nacionalidades = [
      "Argentina",
      "Brasil",
      "Chile",
      "Paraguay",
      "Uruguay",
    ];
  ReactDOM.render(
    <Nacionalidades nacionalidades={nacionalidades} />,  document.getElementById('nac'));

  export default Nacionalidades;
